#!/usr/bin/env python
import urllib, json

def main():

    # retrieve jobs queue from Stampede and load json into 'data' variable
    queueURL   = "https://portal.tacc.utexas.edu/commnq/stampede.tacc.utexas.edu/queue.json"
    response   = urllib.urlopen( queueURL )
    data       = json.loads( response.read() )

    # keep track of project ID's and store each longitude, latitude
    # coordinate in dictionary
    locationsDict = {}

    # Latitudes and longitudes to institutions
    longs         = {}
    lats          = {}

    populateLats(lats)
    populateLongs(longs)

    # only keep running jubs
    for job in data["running"]:

        # if projectID already exists then append to jobs list of project,
        #  and move to next ID
        projectID = job["Extension"]["LocalAccount"]
        if projectID not in locationsDict:

            # set projectURL for project request
            projectURL = 'https://tas.tacc.utexas.edu/api/web/project?name=' + projectID

            # request project data and load JSON
            response   = urllib.urlopen( projectURL )
            project    = json.loads( response.read() )

            # JSON for lat and long for one institution
            temp = {}

            institution = project["pi_institution"]
            print(institution)

            # Unpack longitude and latitude
            temp["latitude"]  = lats[institution]
            temp["longitude"] = longs[institution]

            locationsDict[project["pi_institution"]] = temp
            print(temp)

    # print("LATS")
    # print(lats)
    # print("LONGS")
    # print(longs)
    #print(locationsDict)

    # print out projects list to file
    with open( 'institution_locations.json', 'w' ) as outfile:
        json.dump( [locationsDict], outfile )


